// Timeline.js
import React from 'react';

const moments = [
  { title: 'Your 2025 Journey', desc: 'Setiap momen adalah kenangan, setiap langkah adalah harapan.' },
  { title: 'Quote 1', desc: '“Hidup adalah kumpulan momen kecil yang layak dirayakan.”' },
  { title: 'Quote 2', desc: '“Jangan takut melangkah, setiap langkah adalah cerita.”' },
  { title: 'Quote 3', desc: '“Semoga tahun ini membawa lebih banyak tawa dan harapan.”' },
  { title: 'Akhir Tahun', desc: 'Terima kasih sudah menjadi bagian dari perjalanan ini.' },
];

function Timeline() {
  return (
    <section style={{
      background: 'linear-gradient(135deg, rgba(224,231,239,0.92) 0%, rgba(247,246,242,0.92) 60%, rgba(184,198,219,0.92) 100%)',
      borderRadius: 32,
      padding: '2.8rem 1.5rem',
      margin: '2.5rem auto',
      maxWidth: 900,
      boxShadow: '0 8px 40px 0 #b8c6db44',
      color: '#232946',
      textAlign: 'center',
      backdropFilter: 'blur(8px)',
      WebkitBackdropFilter: 'blur(8px)',
      border: '1.5px solid #b8c6db33',
      transition: 'background 0.6s',
    }}>
      <h2 style={{
        fontSize: '2.3rem',
        fontWeight: 800,
        marginBottom: 18,
        background: 'linear-gradient(90deg, #e0e7ef 30%, #b8c6db 70%)',
        WebkitBackgroundClip: 'text',
        WebkitTextFillColor: 'transparent',
        letterSpacing: '-1px',
        textShadow: '0 4px 24px #23294699',
      }}>Your 2025 Journey</h2>
      <div style={{
        fontSize: '1.18rem',
        fontWeight: 500,
        color: '#b8c6db',
        marginBottom: 18,
        letterSpacing: '-0.5px',
      }}>{moments[0].desc}</div>
      <div style={{margin: '0 auto 1.5rem auto', maxWidth: 600}}>
        <div style={{color: '#e0e7ef', fontStyle: 'italic', fontSize: '1.13rem', marginBottom: 8}}>{moments[1].desc}</div>
        <div style={{color: '#e0e7ef', fontStyle: 'italic', fontSize: '1.13rem', marginBottom: 8}}>{moments[2].desc}</div>
        <div style={{color: '#e0e7ef', fontStyle: 'italic', fontSize: '1.13rem', marginBottom: 8}}>{moments[3].desc}</div>
      </div>
      <div style={{color: '#b8c6db', fontSize: '1.08rem', marginBottom: 18, fontStyle: 'italic'}}>{moments[4].desc}</div>
    </section>
  );
}

export default Timeline;
